#!/usr/bin/env python3
"""
Swing Scanner
Scans for multi-day swing trade setups under $50
Sources: Yahoo Finance + TipRanks + Simply Wall St + Reddit
"""

import yfinance as yf
import requests
from datetime import datetime

def get_tipranks_data(ticker):
    try:
        url = f"https://www.tipranks.com/api/stocks/?ticker={ticker}"
        headers = {'User-Agent': 'Mozilla/5.0'}
        response = requests.get(url, headers=headers, timeout=5)
        if response.status_code == 200:
            data = response.json()
            if data and len(data) > 0:
                return {
                    'rating': data[0].get('rating', 'N/A'),
                    'price_target': data[0].get('priceTarget', 'N/A'),
                    'analyst_count': data[0].get('analystCount', 0),
                    'sentiment': data[0].get('sentiment', 'N/A'),
                    'score': data[0].get('technicalScore', 'N/A')
                }
    except Exception:
        pass
    return None

def get_simply_wall_st_data(ticker):
    try:
        url = f"https://api.simplywall.st/v1/stocks/{ticker}"
        headers = {'User-Agent': 'Mozilla/5.0'}
        response = requests.get(url, headers=headers, timeout=5)
        if response.status_code == 200:
            data = response.json()
            return {
                'score': data.get('score', 'N/A'),
                'quality': data.get('qualityScore', 'N/A'),
                'value': data.get('valueScore', 'N/A'),
                'momentum': data.get('momentumScore', 'N/A'),
                'dividend': data.get('dividendScore', 'N/A'),
                'future': data.get('futureScore', 'N/A'),
                'health': data.get('healthScore', 'N/A')
            }
    except Exception:
        pass
    return None

def get_reddit_data(ticker):
    try:
        headers = {'User-Agent': 'Mozilla/5.0'}
        subreddits = ['wallstreetbets', 'stocks', 'investing', 'options', 'stockmarket']
        mentions = 0

        for sub in subreddits:
            try:
                url = f"https://www.reddit.com/r/{sub}/search.json?q={ticker}&sort=hot&limit=10"
                response = requests.get(url, headers=headers, timeout=5)
                if response.status_code == 200:
                    data = response.json()
                    if 'data' in data and 'children' in data['data']:
                        mentions += len(data['data']['children'])
            except Exception:
                continue

        return {'mentions': mentions, 'buzz': 'HIGH' if mentions > 20 else 'MEDIUM' if mentions > 5 else 'LOW'}
    except Exception:
        pass
    return None

def calculate_rsi(prices, period=14):
    delta = prices.diff()
    gain = (delta.where(delta > 0, 0)).rolling(window=period).mean()
    loss = (-delta.where(delta < 0, 0)).rolling(window=period).mean()
    rs = gain / loss
    rsi = 100 - (100 / (1 + rs))
    return rsi.iloc[-1] if len(rsi) > 0 else 50

def scan_swing_stocks():
    tickers = [
        'AAPL', 'MSFT', 'GOOGL', 'AMZN', 'NVDA', 'TSLA', 'META', 'AMD', 'INTC', 'NFLX',
        'COIN', 'PLTR', 'SNAP', 'RIVN', 'LCID', 'NIO', 'BABA', 'SPOT', 'ROKU', 'SQ',
        'SHOP', 'CROX', 'SNOW', 'DDOG', 'NET', 'CRWD', 'ZS', 'PINS', 'W', 'ZM',
        'DOCU', 'TEAM', 'OKTA', 'GPRO', 'HOOD', 'U', 'MRNA', 'SIRI', 'NOK', 'SOFI',
        'UPST', 'BILL', 'APP', 'DLO', 'FVRR', 'RBLX', 'ESTA', 'AMWL', 'CFLT', 'NCNO'
    ]

    results = []

    for ticker in tickers:
        try:
            stock = yf.Ticker(ticker)
            hist = stock.history(period="2mo")
            if len(hist) < 30:
                continue

            info = stock.info
            price = info.get('currentPrice', 0)

            if price > 50:
                continue

            current_price = hist['Close'].iloc[-1]
            ma_50 = hist['Close'].tail(50).mean()
            ma_200 = hist['Close'].tail(200).mean() if len(hist) >= 200 else ma_50
            rsi = calculate_rsi(hist['Close'])

            tipranks = get_tipranks_data(ticker)
            simply = get_simply_wall_st_data(ticker)
            reddit = get_reddit_data(ticker)

            if current_price > ma_50 and rsi < 70 and price < 50:
                week_change = ((current_price - hist['Close'].iloc[-5]) / hist['Close'].iloc[-5]) * 100

                result = {
                    'ticker': ticker,
                    'price': round(current_price, 2),
                    'ma_50': round(ma_50, 2),
                    'ma_200': round(ma_200, 2),
                    'rsi': round(rsi, 1),
                    'week_change': round(week_change, 2),
                    'name': info.get('shortName', ticker),
                    'trend': 'BULLISH' if current_price > ma_200 else 'NEUTRAL'
                }
                if tipranks:
                    result['tipranks'] = tipranks
                if simply:
                    result['simply'] = simply
                if reddit:
                    result['reddit'] = reddit
                results.append(result)
        except Exception:
            continue

    results.sort(key=lambda x: x['rsi'])
    return results[:8]

if __name__ == "__main__":
    print("Running Swing Scanner...")
    print("Sources: Yahoo Finance + TipRanks + Simply Wall St + Reddit\n")
    results = scan_swing_stocks()

    print(f"{'='*65}")
    print(f"SWING TRADE SETUPS - {datetime.now().strftime('%Y-%m-%d %H:%M')}")
    print(f"{'='*65}\n")

    for i, stock in enumerate(results, 1):
        print(f"{i}. {stock['ticker']} - {stock['name']}")
        print(f"   Price: ${stock['price']} | RSI: {stock['rsi']}")
        print(f"   MA50: ${stock['ma_50']} | MA200: ${stock['ma_200']}")
        print(f"   Week: {stock['week_change']}% | Trend: {stock['trend']}")

        if 'tipranks' in stock:
            tr = stock['tipranks']
            print(f"   TipRanks: {tr.get('rating', 'N/A')} | Target: ${tr.get('price_target', 'N/A')}")

        if 'simply' in stock:
            sws = stock['simply']
            print(f"   Simply: Quality={sws.get('quality', 'N/A')} | Value={sws.get('value', 'N/A')}")

        if 'reddit' in stock:
            rd = stock['reddit']
            print(f"   Reddit: {rd.get('mentions', 0)} mentions | Buzz: {rd.get('buzz', 'N/A')}")
        print()

